tended'=>'Activos y Páginas Web - Extendidos','Cache enabled for assets and pages (extended).'=>'Caché habilitada para recursos y páginas (extendido).','Tuned for sites that update a few times a month or less.'=>'Optimizado para sitios que se actualizan unas pocas veces al mes o menos.','Boost speed and performance by storing a copy of your website content, files, and images online so the pages of your website load faster for your visitors.'=>'Aumenta la velocidad y el rendimiento almacenando una copia del contenido, archivos e imágenes de su sitio web en línea para que las páginas de tu sitio web se carguen más rápido para tus visitantes.','Cache setting saved'=>'Configuración de caché guardada','Clear All Cache Now'=>'Limpiar todo el Caché ahora','We automatically clear your cache as you work (creating content, changing settings, installing plugins and more). But you can manually clear it here to be confident it is fresh.'=>'Limpiamos automáticamente tu caché mientras trabajas (creando contenido, cambiando configuraciones, instalando complementos y más). Pero puedes borrarlo manualmente aquí para estar seguro de que está actualizado.','Cache cleared'=>'Caché Borrado','Clear Cache'=>'Limpiar Caché','Exclude from cache'=>'Excluir del caché','This setting controls what pages pass a “no-cache” header so that page caching and browser caching is not used.'=>'Esta configuración controla qué páginas pasan un encabezado “no-cache” para que no se utilice el almacenamiento en caché de páginas ni el almacenamiento en caché del navegador.','Cache Exclusion saved'=>'Exclusión de caché guardada','Save'=>'Guardar','Skip 404'=>'Saltar 404','When enabled, static resources like images and fonts will use a default server 404 page and not WordPress 404 pages. Pages and posts will continue using WordPress for 404 pages. This can considerably speed up your website if a static resource like an image or font is missing.'=>'Cuando está habilitado, los recursos estáticos como imágenes y fuentes usarán una página 404 predeterminada del servidor y no las páginas 404 de WordPress. Las páginas y publicaciones seguirán usando WordPress para las páginas 404. Esto puede acelerar considerablemente tu sitio web si falta un recurso estático como una imagen o una fuente.','Skip 404 saved'=>'Saltar 404 guardado','Image Optimization'=>'Optimización de Imagen','We automatically optimize your uploaded images to WebP format for faster performance and reduced file sizes. You can also choose to delete the original images to save storage space.'=>'Optimizamos automáticamente tus imágenes cargadas al formato WebP para un rendimiento más rápido y tamaños de archivo reducidos. También puedes optar por eliminar las imágenes originales para ahorrar espacio de almacenamiento.','Enable Image Optimization'=>'Habilitar Optimización de Imagen','Enable or disable image optimization globally.'=>'Habilitar o deshabilitar la optimización de imágenes globalmente.','Automatically Optimize Uploaded Images'=>'Optimizar automáticamente las imágenes cargadas','When enabled, all your new image uploads will be automatically optimized to WebP format, ensuring faster page loading and reduced file sizes.'=>'Cuando está habilitado, todas tus nuevas cargas de imágenes se optimizarán automáticamente al formato WebP, lo que garantiza una carga de página más rápida y tamaños de archivo reducidos.','Auto Delete Original Image'=>'Eliminar automáticamente la imagen original','When enabled, the original uploaded image is deleted and replaced with the optimized version, helping to save storage space. If disabled, the optimized image is saved as a separate file, retaining the original.'=>'Cuando está habilitado, la imagen original cargada se elimina y se reemplaza con la versión optimizada, lo que ayuda a ahorrar espacio de almacenamiento. Si está deshabilitado, la imagen optimizada se guarda como un archivo separado, conservando la original.','No settings available.'=>'No hay configuraciones disponibles.','Oops! Something went wrong. Please try again.'=>'¡Ups! Algo salió mal. Por favor, inténtalo de nuevo.','Loading settings…'=>'Cargando configuraciones…','Settings updated successfully'=>'Configuraciones actualizadas exitosamente','Your image optimization settings have been saved.'=>'Se han guardado tus configuraciones de optimización de imágenes.','Enable Lazy Loading'=>'Habilitar carga diferida','Lazy loading defers the loading of images until they are visible on the screen, improving page load speed and performance.'=>'La carga diferida pospone la carga de imágenes hasta que estén visibles en la pantalla, lo que mejora la velocidad de carga de la página y el rendimiento.','Lazy loading has been updated.'=>'La carga diferida se ha actualizado.','Oops! There was an error updating the lazy loading settings.'=>'¡Ups! Hubo un error al actualizar la configuración de carga diferida.','Enable Bulk Optimization of Images'=>'Habilitar optimización masiva de imágenes','When enabled, allows bulk optimization of images in the media library.'=>'When enabled, allows bulk optimization of images in the media library.','Go to Media Library'=>'Ir a la biblioteca de medios','Error Updating Settings'=>'Error al actualizar la configuración','Prefer Optimized Image When Exists'=>'Preferir imagen optimizada cuando exista','When enabled, optimized images will be served in place of original images when they exist, improving performance.'=>'Cuando está habilitado, se mostrarán las imágenes optimizadas en lugar de las imágenes originales cuando existan, lo que mejora el rendimiento.','Something went wrong while updating the settings. Please try again.'=>'Ocurrió un error al actualizar la configuración. Vuelve a intentarlo.','Asks the browser to download and cache links on the page ahead of them being clicked on, so that when they are clicked they load almost instantly.'=>'Le pide al navegador que descargue y almacene en caché los enlaces de la página antes de que se haga clic en ellos, para que cuando se haga clic, se carguen casi instantáneamente.','Link prefetching setting saved'=>'Configuración de precarga de enlaces guardada','Link Prefetch'=>'Precarga de enlaces','Enable link prefetching on desktop'=>'Activar la precarga de enlaces en el escritorio','Activate on desktop'=>'Activar en escritorio','Behavior of the prefetch'=>'Comportamiento de la precarga','Behavior'=>'Comportamiento','Prefetch on Mouse Down'=>'Precarga al hacer clic en el botón','Prefetch on Mouse Down: Starts loading the page as soon as you click down, for faster response when you release the click.'=>'Precarga al presionar el botón del mouse: Comienza a cargar la página tan pronto como presionas el botón del mouse, para una respuesta más rápida cuando lo sueltas.','Prefetch on Mouse Hover (Recommended)'=>'Precarga al pasar el cursor (recomendado)','Prefetch on Mouse Hover: Begins loading the page the moment your cursor hovers over a link'=>'Precarga al pasar el cursor: comienza a cargar la página en el momento en que el cursor pasa por encima de un enlace','Enable link prefetching on mobile'=>'Activar la precarga de enlaces en móviles','Activate on mobile'=>'Activar en móvil','Prefetch on Touchstart (Recommended)'=>'Precarga al tocar la pantalla táctil (recomendado)','Prefetch on Touchstart: Instantly starts loading the page as soon as you tap the screen, ensuring a quicker response when you lift your finger.'=>'Precarga al tocar la pantalla: Comienza a cargar la página instantáneamente tan pronto como tocas la pantalla, lo que garantiza una respuesta más rápida cuando levantas el dedo.','Prefetch Above the Fold'=>'Precarga en vista actual','Prefetch Above the Fold: Loads links in your current view instantly, ensuring they\'re ready when you need them.'=>'Precarga sobre el pliegue: Carga los enlaces en tu vista actual al instante, asegurándose de que estén listos cuando los necesites.','Exclude Keywords: A comma separated list of words or strings that will exclude a link from being prefetched. For example, excluding "app" will prevent https://example.com/apple from being prefetched.'=>'Excluir palabras clave: Una lista separada por comas de palabras o cadenas que excluirán un enlace de la precarga. Por ejemplo, excluir “app” evitará que se precargue https://example.com/apple.','Exclude keywords'=>'Excluir palabras clave','Advanced settings'=>'Configuración avanzada','Additional speed and scalability features powered by Jetpack Boost to make your site as fast as it can be.'=>'Funciones adicionales de velocidad y escalabilidad con Jetpack Boost para que tu sitio sea lo más rápido posible.','Optimize Critical CSS Loading (manual)'=>'Optimizar la carga crítica de CSS (manual)','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.'=>'Mueve la información de estilo importante al principio de la página, lo que ayuda a que las páginas muestren su contenido antes, para que tus usuarios no tengan que esperar a que se cargue toda la página. %1$s %2$sBoost generará automáticamente tu CSS crítico%3$s siempre que realices cambios en la estructura HTML o CSS de tu sitio.','Optimize Critical CSS Loading (UPGRADED)'=>'Optimizar la carga de CSS crítico (ACTUALIZADO)','Generate Critical CSS Automatically'=>'Generar CSS crítico automáticamente','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.%1$s %2$sBoost will automatically generate your Critical CSS%3$s whenever you make changes to the HTML or CSS structure of your site.'=>'Mueve la información de estilo importante al principio de la página, lo que ayuda a que las páginas muestren su contenido antes, para que tus usuarios no tengan que esperar a que se cargue toda la página. %1$s %2$sBoost generará automáticamente tu CSS crítico%3$s siempre que realices cambios en la estructura HTML o CSS de tu sitio.','Defer Non-Essential JavaScript'=>'Aplazar JavaScript no esencial','Run non-essential JavaScript after the page has loaded so that styles and images can load more quickly.'=>'Ejecuta JavaScript no esencial después de que la página se haya cargado para que los estilos y las imágenes puedan cargarse más rápidamente.','Concatenate JS'=>'Concatenar JS','Scripts are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Los scripts se agrupan por su ubicación original, se concatenan y se minifican para reducir el tiempo de carga del sitio y reducir el número de peticiones.','Exclude JS Strings'=>'Excluir cadenas JS','Concatenate CSS'=>'Concatenar CSS','Styles are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Los estilos se agrupan por su ubicación original, se concatenan y se minifican para reducir el tiempo de carga del sitio y el número de solicitudes.','Exclude CSS Strings'=>'Excluir cadenas CSS','Show more'=>'Mostrar más','Show less'=>'Mostrar menos','Discover More'=>'Descubrir más','Install Jetpack Boost to unlock'=>'Instalar Jetpack Boost para desbloquear','Installing Jetpack Boost…'=>'Instalando Jetpack Boost…','Jetpack Boost is now active'=>'Jetpack Boost ya está activo','Activation failed'=>'Activación fallida','Discover more %1$shere%2$s'=>'Descubra más %1$saquí%2$s','Option saved correctly'=>'Opción guardada correctamente','Error saving option'=>'Error al guardar la opción','Upgrade to unlock'=>'Haz un upgrade para tener acceso','Autosave Interval'=>'Frecuencia de autoguardado','Autosaving is set to happen every 30 seconds or more'=>'El autoguardado se realiza cada 30 segundos o más','Autosaving is set to be frequent, less than every 30 seconds'=>'El autoguardado se realiza con una frecuencia menor a 30 segundos','Setting the autosave interval to a longer period can reduce server load. It is recommended to set it to 30 seconds or more.'=>'Configurar el intervalo de autoguardado a un período más largo puede reducir la carga del servidor. Se recomienda configurarlo a 30 segundos o más.','Browser Caching'=>'Caché del navegador','Browser caching is enabled'=>'El caché del navegador está activado','Browser caching is disabled'=>'El caché del navegador está desactivado','Enabling browser caching can improve performance by storing static assets in the browser for faster page loads.'=>'Habilitar la caché del navegador puede mejorar el rendimiento al almacenar activos estáticos en el navegador para cargas de página más rápidas.','Cloudflare enabled'=>'Cloudflare está habilitado','Cloudflare integration is enabled'=>'La integración de Cloudflare está activada','Cloudflare integration is disabled'=>'La integración de Cloudflare está desactivada','Cloudflare integration can improve performance and security.'=>'La integración de Cloudflare puede mejorar el rendimiento y la seguridad.','CSS files are concatenated'=>'Los archivos CSS se han combinado','CSS files are not concatenated'=>'Los archivos CSS no se han combinado','Concatenating CSS can improve performance by reducing the number of requests.'=>'La concatenación de CSS puede mejorar el rendimiento al reducir el número de solicitudes.','Concatenate JavaScript'=>'Combinar JavaScript','JavaScript files are concatenated'=>'Los archivos JavaScript se han combinado','JavaScript files are not concatenated'=>'Los archivos JavaScript no se han combinado','Concatenating JavaScript can improve performance by reducing the number of requests.'=>'La concatenación de JavaScript puede mejorar el rendimiento al reducir el número de solicitudes.','WP Cron Lock Timeout'=>'Tiempo límite del bloqueo de WP Cron','Cron lock timeout is set to 60 seconds or less.'=>'El tiempo límite del bloqueo de cron está establecido en 60 segundos o menos.','Cron lock timeout is set to a high number.'=>'El tiempo límite del bloqueo de cron está establecido en un número elevado.','Cron lock timeout affects how long a cron job can run for. Setting it to a lower number can improve performance.'=>'El tiempo de espera del bloqueo de cron afecta la duración máxima de un trabajo cron. Configurarlo a un número menor puede mejorar el rendimiento.','Non-essential JavaScript is deferred'=>'El código JavaScript esencial se ejecuta de forma diferida','Non-essential JavaScript is not deferred'=>'El código JavaScript esencial no se ejecuta de forma diferida','JavaScript can be deferred to improve performance by loading it after the page has loaded.'=>'Se puede aplazar la carga de JavaScript para mejorar el rendimiento cargándolo después de que se haya cargado la página.','Empty Trash Days'=>'Días para vaciar la papelera','Trash is emptied every 30 days or less'=>'La papelera se vacía cada 30 días o menos','Trash is emptied less frequently than every 30 days.'=>'La papelera se vacía con menos frecuencia que cada 30 días.','Emptying the trash more frequently can reduce database bloat.'=>'Vaciar la papelera con más frecuencia puede reducir la hinchazón de la base de datos.','Lazy Loading'=>'Carga diferida','Lazy loading is enabled'=>'La carga diferida está activada','Lazy loading is disabled'=>'La carga diferida está desactivada','Lazy loading can improve performance by only loading images when they are in view.'=>'La carga diferida (lazy loading) puede mejorar el rendimiento al cargar las imágenes solo cuando están a la vista.','Link Prefetching'=>'Precarga de enlaces','Link prefetching is enabled'=>'La pre carga de enlaces está activada','Link prefetching is disabled'=>'La precarga de enlaces está desactivada','Link prefetching can improve performance by loading pages immediately before they are requested.'=>'La precarga de enlaces puede mejorar el rendimiento al cargar las páginas inmediatamente antes de que se soliciten.','Page Caching'=>'Caché de página','Page caching is enabled'=>'El caché de página está activado','Page caching is disabled'=>'El caché de página está desactivado','Page caching can improve performance by bypassing PHP and database queries for faster page loads.'=>'El almacenamiento en caché de páginas puede mejorar el rendimiento al omitir las consultas de PHP y la base de datos para cargas de página más rápidas.','Permalinks'=>'Enlaces permanentes','Permalinks are pretty'=>'Los enlaces permanentes tienen una estructura amigable','Permalinks are not set up'=>'Los enlaces permanentes no están configurados','Setting permalinks to anything other than plain can improve performance and SEO.'=>'Configurar los enlaces permanentes a cualquier otra opción que no sea “plain” (plano) puede mejorar el rendimiento y el SEO.','Object Caching'=>'Caché de objetos','Object caching is enabled'=>'El caché de objetos está habilitado','Object caching is disabled'=>'El caché de objetos está deshabilitado','Object caching saves results from frequent database queries, reducing load times by avoiding repetitive query processing. Object caching is available in all tiers of Bluehost Cloud.'=>'El almacenamiento en caché de objetos guarda los resultados de las consultas frecuentes a la base de datos, lo que reduce los tiempos de carga al evitar el procesamiento repetitivo de consultas. El almacenamiento en caché de objetos está disponible en todos los niveles de Bluehost Cloud.','Learn more about object caching'=>'Aprender más sobre el almacenamiento en caché de objetos','Post Revisions'=>'Revisiones de publicaciones','Number of post revisions is limited to 5 or less'=>'El número de revisiones de publicaciones está limitado a 5 o menos','Number of post revisions is set to a high number'=>'El número de revisiones de publicaciones está configurado a un número alto','Setting the number of post revisions to a lower number can reduce database bloat.'=>'Configurar el número de revisiones de publicaciones a un número menor puede reducir la expansión de la base de datos.','Prioritize C